use mydatabase;

Create table products (
 prid int  primary key AUTO_INCREMENT not null,
 prname nvarchar(200),
 total int ,
 importprice bigint,
 price bigint,
 oldprice bigint,
 lineprid int ,
 totalview int,
 totallike int,
 image nvarchar(200),
 mnday datetime,
 expirydate datetime,
 createday datetime,
 highlight int ,
 foreign key (lineprid) references lineproducts(lineprid)
);
create table imageproducts(
	imgid int  not null  AUTO_INCREMENT ,
	image nvarchar(500),
	prid int,
    primary key (imgid),
	foreign key (prid) references products(prid)
);
Create table evaluates(
evaid int primary key not null  AUTO_INCREMENT,
evaluate int,
prid int ,
usid int ,
note nvarchar(2000),
foreign key (prid) references products(prid),
foreign key (usid) references users(usid)
);
Create table comment(
cmtid int not null auto_increment primary key,
comment nvarchar(3000),
prid int ,
usid int,
foreign key (prid) references  products(prid),
foreign key (usid) references  users(usid)
);

CREATE TABLE `devvn_tinhthanhpho` (
  matp varchar(5) CHARACTER SET utf8 NOT NULL,
  name varchar(100) CHARACTER SET utf8 NOT NULL,
  type varchar(30) CHARACTER SET utf8 NOT NULL,
  PRIMARY KEY (`matp`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;

CREATE TABLE `devvn_quanhuyen` (
  maqh varchar(5) CHARACTER SET utf8 NOT NULL,
  name varchar(100) CHARACTER SET utf8 NOT NULL,
  type varchar(30) CHARACTER SET utf8 NOT NULL,
  matp varchar(5) CHARACTER SET utf8 NOT NULL,
  PRIMARY KEY (maqh),
  foreign key (matp) references devvn_tinhthanhpho(matp)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


CREATE TABLE `devvn_xaphuongthitran` (
  xaid varchar(5) CHARACTER SET utf8 NOT NULL,
  name varchar(100) CHARACTER SET utf8 NOT NULL,
  type varchar(30) CHARACTER SET utf8 NOT NULL,
  maqh varchar(5) CHARACTER SET utf8 NOT NULL,
  PRIMARY KEY (xaid),
  foreign key (maqh) references devvn_quanhuyen(maqh)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




